import React from 'react'
import { Container } from 'react-bootstrap'

const Timeline = () => {
    return (
        <>
            <Container fluid className="p-0">
                <div className="roadmap" id="roadmap">
                    <h1 style={{ color: '#fff', textAlign: 'center' }}>short-term timeline</h1>
                    <main>
                        <p>
                            Inception of Idea<br />
                            Creation of Base Assets<br />
                            Securing Core Team
                        </p>
                        <p>
                            Discord Launch<br />
                            Twitter Launch<br />
                            Creation of Peripheral Assets<br />
                            Securing Partners<br />
                            White Paper Reveal<br />
                            Art Reveal<br />
                            Giveaways and Promotions<br />
                            Whitelisting Process
                        </p>
                        <p>
                            Whitelist Genesis Auction<br />
                            Genesis Drop<br />
                            Cycle 1 of Merging Start
                        </p>
                        <p>
                            Big Asset Giveaway<br />
                            Community Auction<br />
                            Charity Drive Launch<br />
                            2 Cycle Pause on Merging
                        </p>
                    </main>
                </div>
                <div>
                    <a href="https://youtu.be/WuE_w_sLTSY" target="_blank" data-keyframers-credit style="color: #FFF"></a>
                    <script src="https://codepen.io/shshaw/pen/QmZYMG.js"></script>

                    <nav class="bar-navigation">
                        <ul class="nav-list" style="--total: 4;">
                            <li class="nav-item" style="--i:0; --color: var(--color-green)" tabindex="1">
                            </li>
                            <li class="nav-item" style="--i:1; --color: var(--color-gold)" tabindex="2"></li>
                            <li class="nav-item" style="--i:2; --color: var(--color-purple)" tabindex="3"></li>
                            <li class="nav-item" style="--i:3; --color: var(--color-red)" tabindex="4"></li>
                        </ul>
                    </nav>
                </div>
            </Container>
        </>
    )
}

export default Timeline

// Short-term Timeline:

// January 2022
// Inception of Idea
// Creation of Base Assets
// Securing Core Team

// February 2022
// Discord Launch
// Twitter Launch
// Creation of Peripheral Assets
// Securing Partners
// White Paper Reveal
// Art Reveal
// Giveaways and Promotions
// Whitelisting Process

// March 2022
// Whitelist Genesis Auction
// Genesis Drop
// Cycle 1 of Merging Start

// April 2022
// Big Asset Giveaway
// Community Auction
